export function diets(d) {
    if (typeof d === "string"){
        return d
    }else{
        return d.name
    }
  }

export function steps(data){
    if (typeof data === "string"){
        return data
    }else{
        let pasos = data.steps.steps.map(i=>"Step" + i.number + ":" + i.step)
        return pasos 
    }
}
